import React from 'react';
import Header from './Header';

const layoutStyle = {
  padding: 30,
  border: '1px solid #DDD',
  fontFamily: 'Montserrat, sans-serif',
  backgroundColor
};

const Layout = ({ children }) => (
  <div style={layoutStyle}>
    <Header />
    {children}
  </div>
);

export default Layout;
